import forest from './images/forest.jpg';
import hare from './images/hare.jpg';
import dinning from './images/dinning-and-kitchen.jpg';

const objects = [
  {
    picture: forest,
    rating: 5.8,
    reviewCount: 6,
    country: 'USA',
    title: 'Life lessons with Katie Zaferes'
  }
];

export default function Footer() {
  return (
    <footer className="footer">
        <Card picture={ forest } rating={ 5.8 } reviewCount={ 6 } country='USA' title='Life lessons with Katie Zaferes' price={ 136 } />
        <Card picture={ hare } rating={ 4.5 } reviewCount={ 4 } country='England' title='On our way to sucess' price={ 100 } />
        <Card picture={ dinning } rating={ 7.9 } reviewCount={ 9 } country='Turkey' title='The very final lap' price={ 150 } />
        
    </footer>
  );
};
